                            {/*    title="Recommended Items"*/}
                            {/*/>*/}
                            <ListingItems columns={6} pageSize={18} />
                        </div>
                    </div>
                </div>
            </div>
        </ContainerShop>
    );
};
export default ShopDefaultPage;
